import React from 'react';
import styles from './NotFoundBlock.module.scss'

const NotFoundBlock = () => {
  return (
    <h1 className={styles.main}>
      <span>&#x1F629;</span>
      <br/>
      Not Found !!!
    </h1>
  );
};

export default NotFoundBlock;
